import React from "react";
import ReactDOM from "react-dom";
import Cards from "./Cards";
import Sdata from "./Sdata";


function ncard(value) {
    return (
        <Cards
            imgsrc={Sdata[0].imgsrc}
            title={Sdata[0].title}
            link={Sdata[0].link}
            seriesname={Sdata[0].seriesName}
        />
    )
}

ReactDOM.render(

    Sdata.map(ncard)
    , document.getElementById('root')
)
